import React from "react";
import { getToken } from "./Common";

const privateRoute = ({ component: Component, ...rest }) => {
  return (
    <Route
      {...rest}
      render={(probs) => {
        getToken() ? (
          <Component {...props} />
        ) : (
          <Redirect
            to={{ pathname: "/Login", state: { from: probs.location } }}
          />
        );
      }}
    />
  );
};

export default privateRoute;
